import logo from './logo.svg';
import { useEffect,useState } from 'react';
import './App.css';
import axios from "axios";

function App() {
  const [string,setString] = useState(null);
  useEffect(()=>{
    axios.get("/barcodes/check").then(res => {
      setString(res.data);
    });
  })
  return (
    <div className="App">
      <p>String is {string}</p>
    </div>
  );
}

export default App;
